import { NextPage } from 'next'
import { makeStyles } from '@material-ui/core/styles'
import Cookies from 'next-cookies'
import DashboardActions from '../../actions/dashboard.actions'
import Dashboard from '../../types/dashboard.types'
import ListDashboards from '../../components/dashboards/list-dashboards'

const Dashboards: NextPage<Array<Dashboard>> = (Dashboard: Array<Dashboard>) => {
  const dashboards: Array<Dashboard> = Object.values(Dashboard)

  return (
    <div className="container" style={{ marginTop: "25px" }}>
      <ListDashboards dashboards={dashboards} title="My Dashboards"></ListDashboards>
    </div>
  )
}

Dashboards.getInitialProps = async (req): Promise<Array<Dashboard>> => {
  try {
    const Authorization = Cookies(req).id
    const Dashboards = await DashboardActions.getDashboards({ Authorization })
    const Collaboration = await DashboardActions.getCollaboratorations({ Authorization })
    return Dashboards
  } catch (e) {
    return []
  }
}

export default Dashboards
